    const blogs = useSelector(state => {
        console.log(state)
        return state.blogs.blogs
    })
    useEffect(() =>{
        dispatch(getBlogs())
    }, [])
    return(
        <div className={'row'} >
            <div className={'col-12'}>
                <table className="table table-striped">

                </table>
            </div>
        </div>
    )
}
